// src/components/navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import { Backpack, UserCircleGear } from 'phosphor-react';

function NavBar() {
    return (
        <Navbar expand="lg" className="bg-body-tertiary">
            <Container>
                <Navbar.Brand>
                    <Link to="/" style={{ textDecoration: 'none', color: 'black' }}>
                        Voyage-Voyage
                    </Link>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link>
                            <Link to="/my-account" style={{ textDecoration: 'none', marginRight: '50px', display: 'flex', alignItems: 'center', color: 'black' }}>
                                <UserCircleGear size={32} />
                                My Account
                            </Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/my-trips" style={{ textDecoration: 'none', marginRight: '50px', display: 'flex', alignItems: 'center', color: 'black' }}>
                                <Backpack size={32} />
                                My Trips
                            </Link>
                        </Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavBar;
